# - Umbralización binaria: La umbralización binaria es el método más simple de umbralización en el que se utiliza un valor de umbral global para convertir una imagen en blanco y negro. Los píxeles con intensidades mayores al umbral se consideran blanco, mientras que los píxeles con intensidades menores se consideran negros.
# 
# - Umbralización Otsu: El método de umbralización de Otsu calcula automáticamente un umbral óptimo para separar los píxeles de la imagen en dos clases, maximizando la varianza entre las clases y minimizando la varianza dentro de cada clase. Es útil cuando no se conoce el valor de umbral adecuado.
# 
# - Umbralización adaptativa: La umbralización adaptativa calcula un umbral local para cada píxel en función de su entorno (vecindario). Esto es útil para imágenes con iluminación variable. Puedes especificar el tamaño del vecindario y un posible valor de offset.
# 
# - Umbralización Niblack:  La umbralización de Niblack es una variante de la umbralización adaptativa que utiliza la media y la desviación estándar local del vecindario para calcular el umbral local. Puedes ajustar el tamaño del vecindario y el valor de contraste.
# 
# - Umbralización de Sauvola:  La umbralización de Niblack es una variante de la umbralización adaptativa que utiliza la media y la desviación estándar local del vecindario para calcular el umbral local. Puedes ajustar el tamaño del vecindario y el valor de contraste.
# Una vez vistos los diferentes métodos, el mejor método es el Niblack, ya que se igualan los puntos y podemos verlos con más claridad los puntos. El peor método es el adaptativo, ya que no he conseguido ver la imagen ni los puntos. En segundo lugar, el Sauvola, donde podemos ver bien los puntos, pero en el caso del sol perdemos puntos. Por último, entre las Otsu y binaria, hay más pérdida de píxeles en Otsu.

