import numpy as np
from skimage import io, color, morphology
import matplotlib.pyplot as plt

# Cargar la imagen binaria (blanco y negro)
imagen_binaria = io.imread('Pintura_Puntos.jpg', as_gray=True)

# Elemento estructurante para las operaciones de morfología
elemento_estructurante = morphology.disk(3)  # Ajusta el tamaño según sea necesario

