imagen_erosionada = morphology.erosion(imagen_binaria, selem=elemento_estructurante)

# Aplicar la dilatación
imagen_dilatada = morphology.dilation(imagen_binaria, selem=elemento_estructurante)

# Aplicar la apertura
imagen_apertura = morphology.opening(imagen_binaria, selem=elemento_estructurante)

# Aplicar el cierre
imagen_cierre = morphology.closing(imagen_binaria, selem=elemento_estructurante)

# Mostrar las imágenes resultantes
plt.figure(figsize=(12, 4))

plt.subplot(1, 5, 1)
plt.imshow(imagen_binaria, cmap='gray')
plt.title('Imagen Binaria')

