plt.imshow(imagen_dilatada, cmap='gray')
plt.title('Dilatación')

plt.subplot(1, 5, 4)
plt.imshow(imagen_apertura, cmap='gray')
plt.title('Apertura')

plt.subplot(1, 5, 5)
plt.imshow(imagen_cierre, cmap='gray')
plt.title('Cierre')

plt.tight_layout()
plt.show()


