import numpy as np
from skimage import io, color, morphology, measure

# Cargar la imagen original 
imagen_original = io.imread('Pintura_Puntos.jpg', as_gray=True)

# Tamaño del primer elemento estructurante circular
tamanio_disk = 1

# Umbral fijo
umbral = 0.9

# Función para contar el número de círculos con una configuración específica
def count_circles_with_parameters(imagen_binaria, tamanio_disk, umbral):
    # Elemento estructurante circular con el tamaño especificado
    elemento_disk = morphology.disk(tamanio_disk)

    # Aplicar la erosión con el elemento estructurante circular
    imagen_erosion_disk = morphology.erosion(imagen_binaria, selem=elemento_disk)

    # Umbralizar la imagen erosionada
    imagen_umbral = imagen_erosion_disk > umbral

    # Etiquetar componentes conectados en la imagen binaria
    etiquetas = measure.label(imagen_umbral)

    # Contar el número de círculos identificados
    numero_de_circulos = etiquetas.max()

    return numero_de_circulos

# Obtener el número de círculos con la configuración específica
num_circulos = count_circles_with_parameters(imagen_original, tamanio_disk, umbral)

print(f'Número de Círculos: {num_circulos}')


