import numpy as np
from skimage import io, color, morphology, measure
import matplotlib.pyplot as plt
from itertools import product

def contar_puntos_en_imagen(imagen_color, umbral=0.5, radio_elemento=1):
    # Convertir la imagen a escala de grises
    imagen_gris = color.rgb2gray(imagen_color)

    # Aplicar umbralización
    imagen_binaria = imagen_gris > umbral

    # Aplicar erosión y dilatación con el elemento estructurante circular de radio especificado
    elemento_estructurante = morphology.disk(radio_elemento)
    imagen_erocion = morphology.erosion(imagen_binaria, selem=elemento_estructurante)
    imagen_dilatacion = morphology.dilation(imagen_binaria, selem=elemento_estructurante)

    # Etiquetar los puntos en la imagen binaria
    etiquetas = measure.label(imagen_binaria)

    # Contar el número de puntos etiquetados
    num_puntos = np.max(etiquetas)

    return num_puntos

# Cargar la imagen en color
imagen_color = io.imread('Pintura_Puntos.jpg')

# Definir intervalos para los parámetros
umbral_range = np.linspace(0.1, 0.9, 9)  # Umbral de 0.1 a 0.9 en pasos de 0.1
radio_elemento_range = range(1, 6)  # Radio del elemento estructurante de 1 a 5

# Generar todas las combinaciones posibles de parámetros
combinaciones_parametros = product(umbral_range, radio_elemento_range)

# Iterar a través de las combinaciones de parámetros
resultados = []

for umbral, radio_elemento in combinaciones_parametros:
    num_puntos = contar_puntos_en_imagen(imagen_color, umbral, radio_elemento)
    resultados.append((umbral, radio_elemento, num_puntos))


# In[24]:



# Encontrar la combinación ganadora y el resultado del número de puntos máximo
max_puntos = -1  # Inicializar el máximo número de puntos
mejor_combinacion = None

for umbral, radio_elemento, num_puntos in resultados:
    if num_puntos > max_puntos:
        max_puntos = num_puntos
        mejor_combinacion = (umbral, radio_elemento)

# Imprimir la combinación ganadora y el número máximo de puntos
if mejor_combinacion is not None:
    umbral_ganador, radio_elemento_ganador = mejor_combinacion
    print(f'Combinación ganadora: Umbral={umbral_ganador}, Radio del Elemento={radio_elemento_ganador}')
    print(f'Número máximo de puntos: {max_puntos}')
else:
    print('No se encontró una combinación ganadora.')



